import React from "react";

import "./WritePost.css";

const WritePost = () => {
  return (
    <form action="POST" className="writePostForm">
      <input type="text" name="post_article_title" id="" />
      <input type="text" name="post_article content" id="" />
    </form>
  );
};

export default WritePost;
